import React, { useState } from "react";

const Form = () => {
  const [formData, setFormData] = useState({
    name: "",
    gender: "",
    age: 0,
    work: "",
    residence: "",
    marriage: "",
    bmi: 0.0,
    smoking: "",
    avg_glucose_level: 0.0,
  });

  const handleChange = (e) => {
    setFormData((prevData) => ({
      ...prevData,
      [e.target.name]: e.target.value,
    }));
    console.log(e.target.name, e.target.value);
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle form submission logic here
    console.log(formData);
  };

  //     const generateBMI = () => {
  //         const options = [];
  //         for (let i = 0; i < 99; i++){
  //             options.push(i)
  //         }
  //   };
  return (
    <div className="flex flex-col justify-center items-center h-screen">
      <h1 className="text-4xl font-bold mt-5 mb-5">Stroke Risk Prediction</h1>
      <form className="w-full max-w-md" onSubmit={handleSubmit}>
        <div className="flex flex-row">
          <div className="flex flex-col">
            <div className="mb-4">
              <label
                className="block text-gray-700 text-sm font-bold mb-2"
                htmlFor="name"
              >
                Name
              </label>
              <input
                className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
                id="name"
                type="text"
                name="name"
                value={formData.name}
                onChange={handleChange}
                placeholder="Enter your name"
                required
              />
            </div>
            <div className="mb-4">
              <label
                className="block text-gray-700 text-sm font-bold mb-2"
                htmlFor="email"
              >
                Gender
              </label>

              <select
                className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
                id="gender"
                value={formData.gender}
                onChange={handleChange}
                name="gender"
              >
                <option value="">Select Your Gender</option>
                <option value="male">Male</option>
                <option value="female">Female</option>
              </select>
            </div>
            <div className="mb-4">
              <label
                className="block text-gray-700 text-sm font-bold mb-2"
                htmlFor="age"
              >
                Age
              </label>
              <input
                className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
                id="age"
                name="age"
                value={formData.age}
                onChange={handleChange}
                placeholder="Enter Your Age"
                required
              />
            </div>
            <div className="mb-4">
              <label
                className="block text-gray-700 text-sm font-bold mb-2"
                htmlFor="email"
              >
                Work Type
              </label>

              <select
                className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
                id="work"
                value={formData.work}
                onChange={handleChange}
                name="work"
              >
                <option>Select Your Work Type</option>
                <option value="private">Private</option>
                <option value="self-employed">Self-Employed</option>
                <option value="government">Government Job</option>
                <option value="children">Children / Unemployed</option>
                <option value="never-worked">Never Worked</option>
              </select>
            </div>

            <div className="mb-4">
              <label
                className="block text-gray-700 text-sm font-bold mb-2"
                htmlFor="email"
              >
                Residence Type
              </label>

              <select
                className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
                id="residence"
                value={formData.residence}
                onChange={handleChange}
                name="residence"
              >
                <option value="">Select Your Residence Type</option>
                <option value="urban">Urban</option>
                <option value="rural">Rural</option>
              </select>
            </div>
          </div>
          <div className="flex flex-col">

          </div>
        </div>



        <div className="flex items-center justify-center">
          <button
            className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline"
            type="submit"
          >
            Submit
          </button>
        </div>
      </form>
    </div>
  );
};

export default Form;
